import React from 'react'

class Codes extends React.Component {
    bubbleSort = 'bubblesort';
    insertionSort = 'insertionsort';
    mergeSort = 'mergesort';
    quickSort = 'quicksort';
    selectionSort = 'selectionsort';
}

export default Codes
